import React, { createContext, use, useContext, useState } from "react";

const GenericDates = createContext()

const GenericDatesProvider = ({ children }) => {

    const [dates, setDates] = useState({
        1: {
            terrenos: 1000,
            lojasP: 2000,
            lojasM: 3000,
            lojasG: 4000
        },
        2: {
            terrenos: 1100,
            lojasP: 2030,
            lojasM: 3200,
            lojasG: 4400
        },
        3: {
            terrenos: 1300,
            lojasP: 2400,
            lojasM: 3040,
            lojasG: 4050
        },
    })

}
